script: |
  super -f text -I q7545.spq | sort > q7545.out

inputs:
  - name: q7545.spq
    data: |
      SELECT DISTINCT + col1 + + cor0.col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL >= NULL OR ( col0 ) NOT BETWEEN ( cor0.col2 + col0 * col2 ) AND col1;
  - name: tab2

outputs:
  - name: q7545.out
    data: |
      55
      58
      85
